import React, { Component } from "react";

import { Redirect } from "react-router-dom";

export default class Logout extends Component{
  constructor(props){
    super(props)
    localStorage.removeItem("auth")
    this.props.logout(false)
  }

  render(){
    return (
      <>
      <Redirect to="/login" />
      <h1>Welcome to logout page</h1>
      </>
      )
  }
}
